import React, { useEffect, useState, useContext } from 'react';
import { Link } from 'react-router-dom';
import '../styles/Home.css';
import { getUserProfile } from '../services/api';
import { AuthContext } from '../context/AuthContext';

function Home() {
  const [userData, setUserData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const { user, isAuthenticated } = useContext(AuthContext);

  // Perform additional authentication check
  const token = localStorage.getItem('token');
  const storedUser = localStorage.getItem('user');
  const hasToken = !!token;
  const hasStoredUser = !!storedUser;
  const shouldShowAuthenticatedView = isAuthenticated || hasToken || hasStoredUser;

  useEffect(() => {
    // Debugging logs
    console.log('----------Authentication Debug Info----------');
    console.log('isAuthenticated from context:', isAuthenticated);
    console.log('user from context:', user);
    console.log('token in localStorage:', token ? 'exists' : 'missing');
    console.log('user in localStorage:', storedUser);
    console.log('shouldShowAuthenticatedView:', shouldShowAuthenticatedView);
    console.log('--------------------------------------------');

    // Clear the just logged in flag if it exists
    const justLoggedIn = sessionStorage.getItem('justLoggedIn');
    if (justLoggedIn) {
      console.log('User just logged in, clearing flag');
      sessionStorage.removeItem('justLoggedIn');
    }
  }, [isAuthenticated, user, token, storedUser, shouldShowAuthenticatedView]);

  if (!shouldShowAuthenticatedView) {
    console.log('Rendering non-authenticated Home view');
    return (
      <div className="home-container">
        <div className="welcome-section">
          <h1>Welcome to Oatmeal AI</h1>
          <p>Your intelligent assistant for smart conversations</p>
          <div className="cta-buttons">
            <Link to="/login" className="btn btn-primary">Login</Link>
            <Link to="/signup" className="btn btn-secondary">Sign Up</Link>
          </div>
        </div>
        
        <div className="features-section">
          <div className="feature">
            <h2>AI-Powered Chat</h2>
            <p>Experience intelligent conversations powered by advanced AI.</p>
          </div>
          <div className="feature">
            <h2>Organized Directories</h2>
            <p>Keep your information structured and easily accessible.</p>
          </div>
          <div className="feature">
            <h2>Secure & Private</h2>
            <p>Your data is encrypted and protected at all times.</p>
          </div>
        </div>
      </div>
    );
  }

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  // Show authenticated view if we have any indication the user is logged in
  console.log('Rendering authenticated Home view');
  const displayName = user?.fullName || 
                     (user?.email ? user.email : 
                     (storedUser ? JSON.parse(storedUser).email || 'User' : 'User'));
  
  return (
    <div className="home-container">
      <div className="dashboard">
        <div className="welcome-header">
          <h1>Welcome to Oatmeal AI Directories</h1>
          <p>Hello, {displayName}! Your intelligent workspace is ready.</p>
        </div>
        
        {error && <div className="error-message">{error}</div>}
        
        <div className="directories-section">
          <h2>Your Directories</h2>
          <div className="directories-grid">
            <div className="directory-card">
              <div className="directory-icon">📁</div>
              <h3>Personal</h3>
              <p>Your personal documents and notes</p>
              <Link to="/chat" className="directory-link">Open</Link>
            </div>
            
            <div className="directory-card">
              <div className="directory-icon">💼</div>
              <h3>Work</h3>
              <p>Work-related projects and documents</p>
              <Link to="/chat" className="directory-link">Open</Link>
            </div>
            
            <div className="directory-card">
              <div className="directory-icon">📊</div>
              <h3>Analytics</h3>
              <p>Data analysis and reports</p>
              <Link to="/chat" className="directory-link">Open</Link>
            </div>
            
            <div className="directory-card add-new">
              <div className="directory-icon">➕</div>
              <h3>Create New</h3>
              <p>Add a new directory</p>
              <Link to="/chat" className="directory-link">Create</Link>
            </div>
          </div>
        </div>
        
        <div className="quick-actions">
          <h2>Quick Actions</h2>
          <div className="action-buttons">
            <Link to="/chat" className="action-btn">Start Chatting</Link>
            <Link to="/chat" className="action-btn secondary">Search</Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
